import Button from './components/button';
import './App.css';

class App extends Component {
  constructor(props) {
    super(props);
    this.satate = {};
  }
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <div>
            <img src={require('./assets/biscoito.png')} alt="" />
            <Button />
          </div>
        </header>
      </div>
    );
  }
}

export default App;
